<p>Di y l tng quan nhanh:</p>
<ol>
<li><strong>ls</strong> - lit k ni dung ca th mc.</li>
<li><strong>pwd</strong> - hin th ng dn ca th mc lm vic hin ti.</li>
<li><strong>cd</strong> - Thay i th mc lm vic.</li>
<li><strong>mkdir</strong> - to mt th mc mi.</li>
<li><strong>rmdir</strong> - Xa mt th mc hoc ng dn.</li>
<li><strong>rm</strong> - Xa mt tp tin.</li>
<li><strong>cp</strong> - Sao chp cc tp v th mc, bao gm c ni dung ca chng.</li>
<li><strong>mv</strong> - Di chuyn hoc i tn cc tp v th mc.</li>
<li><strong>touch</strong> - To mt tp trng mi.</li>
<li><strong>file</strong> - Kim tra loi tp.</li>
